<script>
  const btn = document.getElementById('menu-btn');
  const menu = document.getElementById('mobile-menu');

  let isOpen = false;

  function toggleMenu(state) {
    isOpen = state;
    menu.classList.toggle('hidden', !isOpen);
    btn.textContent = isOpen ? 'âœ•' : 'â˜°';
  }

  // klik tombol hamburger
  btn.addEventListener('click', (e) => {
    e.stopPropagation(); // biar gak langsung ketutup karena klik tombol juga dianggap "luar"
    toggleMenu(!isOpen);
  });

  // klik link dalam menu, ubah menjadi close
  menu.querySelectorAll('a').forEach(link => {
    link.addEventListener('click', () => {
      toggleMenu(false);
    });
  });

  // klik di luar menu, ubah menjadi close
  document.addEventListener('click', (e) => {
    if (isOpen && !menu.contains(e.target) && e.target !== btn) {
      toggleMenu(false);
    }
  });
</script>

